import React,{useState,useEffect} from 'react';
import axios from 'axios';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";


const Detail = props => {
  const[detail, setDetail] = useState([])

  useEffect(()=>{
    axios.get(props.url)
    .then(res =>{
      setDetail(res.data)
      console.log(detail);
    })
    .catch(err => {
      console.log(err)
    })
  }, [])

  if (detail.abilities !== undefined) {
  var listAbiliti = (
      <div>
        {detail.abilities.map((res,index)=>
          <div key={index}>
            <p>{res.ability}</p>
          </div>
        )}
      </div>
  )
}
  return(
    <div>
      {listAbiliti}
    </div>
  )
}




export default Detail
